import React from 'react';
import ClassRoutine from '../components/ClassRoutine';
import SchoolInfo from '../components/SchoolInfo';
import Map from '../components/Map';
import WebEditor from '../components/WebEditor';

const App = () => {
  return (
    <div className="app">
      <ClassRoutine />
      <SchoolInfo />
      <Map />
      <WebEditor />
    </div>
  );
};

export default App;
